import React from "react";
import Header from "./components/header";
import Body from "./components/body";
import Footer from "./components/footer";

import Contact from "./components/events/contact";
import ContactFunctions from "./components/events/contactFunctions";

export default class App extends React.Component {
  constructor(props) {
    super(props);

    this.ContactFunctions = new ContactFunctions();


    this.state = {
      contacts: this.ContactFunctions.contacts
    }
  }


  createContact(name, number) {

    let contact = new ContactFunctions(name, number);
    let contacts = this.ContactFunctions.add(contact);

    this.setState({contacts: contacts});
    this.createContact = this.createContact.bind(this);
  }
  render() {
    return (
      <div>
        <Header></Header>
        <Body></Body>
        <Footer createContact={this.createContact}></Footer>
      </div>
    );
  }
}
